func FullNode1() {
	f := &FullNode{}
	b, err := rlp.EncodeToBytes(f)
	if err != nil {
		panic(err)
	}
	fmt.Printf("FullNode1 %x\n", b)
}

func FullNode2() {
	f := &FullNode{}
	f.Children[0] = ValueNode(nil)
	b, err := rlp.EncodeToBytes(f)
	if err != nil {
		panic(err)
	}
	fmt.Printf("FullNode2 %x\n", b)
}

func FullNode3() {
	f := &FullNode{}
	f.Children[0] = ValueNode(nil)
	h := common.Hash{}
	f.Children[1] = HashNode{hash: h[:]}
	b, err := rlp.EncodeToBytes(f)
	if err != nil {
		panic(err)
	}
	fmt.Printf("FullNode3 %x\n", b)
}

func FullNode4() {
	f := &FullNode{}
	h := common.Hash{}
	for i := 0; i < 17; i++ {
		f.Children[i] = HashNode{hash: h[:]}
	}
	b, err := rlp.EncodeToBytes(f)
	if err != nil {
		panic(err)
	}
	fmt.Printf("FullNode4 %x\n", b)
}

